ositions. Cleaves Phe1-Val2, Gln4-His5, Glu13-Ala14, Ala14-Leu15, Leu15-Tyr16, Tyr16-Leu17, Gly23-Phe24, Phe24-Phe25 and Phe25-Tyr26 bonds in the B chain of insulin.'),('GO:0004195','obsolete renin activity','MF','OBSOLETE. Catalysis of the cleavage of Leu-Xaa bond in angiotensinogen to generate angiotensin I.'),('GO:0004196','obsolete saccharopepsin activity','MF','OBSOLETE. Catalysis of the degradation of gelatin; little activity on hemoglobin. Specificity on B chain of insulin more restricted than pepsin A; does not cleave Phe1-Val2, Gln4-His5 or Gly23-Phe24.'),('GO:0004199','obsolete caspase activity','MF','OBSOLETE. Catalysis of the hydrolysis of a peptide bond on the carboxyl side of an aspartate residue.'),('GO:0004200','obsolete signaling (initiator) caspase activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004201','obsolete caspase-1 activity','MF','OBSOLETE. Catalysis of the release of interleukin 1-beta by specific cleavage of Asp116-Ala117 and Asp27-Gly28 bonds in precursor. Enzymes with this function can also hydrolyze the terminal bond in the small-molecule substrate, Ac-Tyr-Val-Ala-Asp-NHMec.'),('GO:0004202','obsolete caspase-2 activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004203','obsolete caspase-4 activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004204','obsolete caspase-5 activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004205','obsolete caspase-8 activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004206','obsolete caspase-10 activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004207','obsolete effector caspase activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0004208','obsolete caspase-3 activity','MF','OBSOLETE. Catalysis of the cleavage at the terminal bond of the motif: Asp-Xaa-Xaa-Asp-Xaa. Enzymes with this function are members of the peptid