gion of the chromosome that always segregates at the first division of meiosis; the region of the chromosome in which no crossing over occurs. At the start of M phase, each chromosome consists of two sister chromatids with a constriction at a point which forms the centromere. During late prophase two kinetochores assemble on each centromere, one kinetochore on each sister chromatid.'),('GO:0005707','obsolete interphase chromosome','CC','OBSOLETE. A chromosome found in the cell during interphase of the cell cycle. Chromosomes are usually decondensed during interphase and each long DNA molecule in a chromosome is divided into a large number of discrete domains that are folded differently.'),('GO:0005708','obsolete mitotic chromosome','CC','OBSOLETE. A chromosome involved in the process of mitosis.'),('GO:0005709','obsolete prophase chromosome','CC','OBSOLETE. A chromosome found in the cell during prophase.'),('GO:0005710','obsolete metaphase chromosome','CC','OBSOLETE. A chromosome found in the cell during metaphase. Typically, sister chromatids are held together at their centromeres and chromosomes are covered with a large number of molecules, including ribonucleoproteins.'),('GO:0005711','obsolete meiotic chromosome','CC','OBSOLETE. A chromosome involved in the process of meiosis.'),('GO:0005733','obsolete small nucleolar RNA','CC','OBSOLETE (was not defined before being made obsolete).'),('GO:0005734','obsolete box C + D snoRNP protein','CC','OBSOLETE (was not defined before being made obsolete).'),('GO:0005735','obsolete box H + ACA snoRNP protein','CC','OBSOLETE (was not defined before being made obsolete).'),('GO:0005755','obsolete hydrogen-transporting ATP synthase, coupling factor CF(0)','CC','OBSOLETE (was not defined before being made obsolete).'),('GO:0005781','obsolete peroxisome targeting signal receptor complex','CC','OBSOLETE (was not defined before being made obsolete).'),('GO:0005792','obsolete microsome','CC','OBSOLETE: Any of the small, heterogeneou