'),('GO:0008539','obsolete proteasome inhibitor activity','MF','OBSOLETE. Stops, prevents or reduces the activity of the proteasome complex. The proteasome complex performs regulated ubiquitin-dependent cytosolic and nuclear proteolysis.'),('GO:0008546','obsolete microtubule/chromatin interaction','BP','OBSOLETE. Physical interaction between microtubules and chromatin via DNA binding proteins.'),('GO:0008547','obsolete protein-synthesizing GTPase activity','MF','OBSOLETE. Catalysis of the reaction: GTP + H2O = GDP + phosphate. A GTPase involved in protein synthesis. In the initiation factor complex, it is IF-2b (98 kDa) that binds GTP and subsequently hydrolyzes it in prokaryotes. In eukaryotes, it is eIF-2 (150 kDa) that binds GTP. In the elongation phase, the GTP-hydrolyzing proteins are the EF-Tu polypeptide of the prokaryotic transfer factor (43 kDa), the eukaryotic elongation factor EF-1a (53 kDa), the prokaryotic EF-G (77 kDa), the eukaryotic EF-2 (70-110 kDa) and the signal recognition particle that play a role in endoplasmic reticulum protein synthesis (325 kDa). EF-Tu and EF1a catalyze binding of aminoacyl-tRNA to the ribosomal A-site, while EF-G and EF-2 catalyze the translocation of peptidyl-tRNA from the A-site to the P-site. GTPase activity is also involved in polypeptide release from the ribosome with the aid of the pRFs and eRFs.'),('GO:0008548','obsolete signal-recognition-particle GTPase activity','MF','OBSOLETE. Catalysis of the reaction: GTP + H2O = GDP + phosphate. Activity is associated with the signal-recognition particle, a protein and RNA-containing structure involved in endoplasmic reticulum-associated protein synthesis.'),('GO:0008549','obsolete dynamin GTPase activity','MF','OBSOLETE. Catalysis of the reaction: GTP + H2O = GDP + phosphate. An enzyme that is involved in endocytosis and is instrumental in pinching off membrane vesicles.'),('GO:0008550','obsolete tubulin GTPase activity','MF','OBSOLETE. Catalysis of the reaction: GTP + H2O = 