ing made obsolete).'),('GO:0015465','obsolete lysin activity','MF','OBSOLETE. An agent that can lyse cells.'),('GO:0015466','obsolete autolysin activity','MF','OBSOLETE. An agent that can lyse the cell in which it is synthesized.'),('GO:0015468','obsolete colicin','MF','OBSOLETE. Plasmid-encoded bacteriocins which are produced by enteric bacteria. Exert a lethal effect on other bacteria including E. coli strains that lack the Col plasmid. Bind to a cell surface receptor and are transported into the periplasm via an energy-dependent process involving a TonB- or TolA-dependent hetero-oligomeric protein complex. Some colicins kill their target cell by inserting into the cytoplasmic membrane where they form voltage-sensitive (trans-negative) channels that depolarize and deenergize the cell, and thereby kill it.'),('GO:0015469','obsolete channel-forming toxin activity','MF','OBSOLETE. A toxin that exerts its effects by forming a channel in a membrane that allows the unregulated passage of substances into and out of the cell.'),('GO:0015470','obsolete bacteriocin activity','MF','OBSOLETE. Polypeptide antibiotic secreted by bacteria and able to kill bacteria of susceptible strains after absorption by specific cell surface receptor.'),('GO:0015472','obsolete fimbrium-specific chaperone activity','MF','OBSOLETE. Assists in the correct assembly of fimbria, extracellular organelles that are used to attach a bacterial cell to a surface, but is not a component of the fimbrium when performing its normal biological function.'),('GO:0015477','obsolete receptor porin activity','MF','OBSOLETE. A porin of the bacterial outer membrane that forms transmembrane pores and transports relatively large molecules from the external milieu to the periplasm in an energized process. Energizing of transport across the outer membrane requires a heterotrimeric complex of proteins, the TonB-ExbB-ExbD complex, or in some cases, the TolA-TolQ-TolR complex. Energizing requires proton motive force across