its left and right halves.'),('GO:0035555','obsolete initiation of Roundabout signal transduction','BP','OBSOLETE. The process in which a SLIT protein causes activation of the receptor, Roundabout (ROBO).'),('GO:0035557','obsolete intracellular signal transduction involved in cell surface receptor linked signaling','BP','OBSOLETE. The process in which a signal is passed on from a receptor at the cell surface to downstream components within the cell, which become activated themselves to further propagate the signal and finally trigger a change in the function or state of the cell.'),('GO:0035558','obsolete phosphatidylinositol 3-kinase cascade involved in insulin receptor signaling','BP','OBSOLETE. The process in which a signal is passed from the insulin receptor to components of the phosphatidylinositol 3-kinase (PI3K) cascade, which become activated themselves to further propagate the signal and finally trigger a change in the function or state of the cell.'),('GO:0035559','obsolete MAPKKK cascade involved in epidermal growth factor receptor signaling','BP','OBSOLETE. The process in which a signal is passed from the epidermal growth factor receptor (EGFR) to components of the MAPKKK cascade, which become activated themselves to further propagate the signal and finally trigger a change in the function or state of the cell.'),('GO:0035569','obsolete N-terminal peptidyl-proline trimethylation','BP','The trimethylation of the N-terminal proline of proteins to form the derivative N,N,N-trimethylproline.'),('GO:0035980','obsolete invasive growth in response to nitrogen limitation','BP','OBSOLETE. The growth of colonies in filamentous chains of cells as a result of a reduced availability of nitrogen.'),('GO:0035982','obsolete age-dependent behavioral decline','BP','OBSOLETE. A developmental process that arises as an organism progresses toward the end of its lifespan that results in a decline in behavioral activities such as locomotory behavior, and learning or memory.'),('GO:0036043','obsolete microspike','CC','OBSOLETE. A dynamic, actin-rich projection extending from the surface of a migrating animal cell.'),('GO:0036044','obsolete protein malonylation','BP','OBSOLETE: The modification of a protein amino acid by the addition of a malonyl (CO-CH2-CO) group.'),('GO:0036045','obsolete peptidyl-lysine malonylation','BP','OBSOLETE. The addition of a malonyl group (CO-CH2-CO) to peptidyl-lysine to form N6-malonyl-L-lysine.'),('GO:0036096','obsolete 3\'-5\'-exoribonuclease activity involved in pre-miRNA 3\'-end processing','MF','OBSOLETE. Catalysis of the sequential cleavage of mononucleotides from a free 3\' terminus of an RNA molecule that contributes to forming the mature 3\' end of a miRNA from a pre-miRNA.'),('GO:0036097','obsolete pre-miRNA 3\'-end processing','BP','OBSOLETE. Any process involved in forming the mature 3\' end of a miRNA from a pre-miRNA.'),('GO:0036226','obsolete mitotic cell cycle arrest in response to glucose starvation','BP','OBSOLETE. The process in which the mitotic cell cycle is halted during one of the normal phases (G1, S, G2, M) as a result of deprivation of glucose.'),('GO:0038067','obsolete MAP kinase activity involved in cell wall organization or biogenesis','MF','OBSOLETE. Catalysis of the reaction: protein + ATP = protein phosphate + ADP by a mitogen-activated protein kinase, as part of a MAPK signaling cascade that contributes to cell wall organization or biogenesis.'),('GO:0038068','obsolete MAP kinase kinase activity involved in cell wall organization or biogenesis','MF','OBSOLETE. Catalysis of the concomitant phosphorylation of threonine (T) and tyrosine (Y) residues in a Thr-Glu-Tyr (TEY) thiolester sequence in a MAP kinase (MAPK) substrate, as part of a MAPK signaling cascade that contributes to cell wall organization or biogenesis.'),('GO:0038069','obsolete MAP kinase phosphatase activity involved in regulation of cell wall biogenesis','MF','OBSOLETE. Catalysis of the reaction: a phosphorylated MAP kinase + H2O = a MAP kinase + phosphate, where the MAP kinase (MAPK) is part of a MAPK signaling cascade that contributes to cell wall biogenesis.'),('GO:0038070','obsolete MAP kinase kinase kinase activity involved in cell wall organization or biogenesis','MF','OBSOLETE. Catalysis of the phosphorylation and activation of a MAP kinase kinase (MAPKK), as part of a MAPK signaling cascade that contributes to cell wall organization or biogenesis.'),('GO:0038071','obsolete MAP kinase activity involved in conjugation with cellular fusion','MF','OBSOLETE. Catalysis of the reaction: protein + ATP = protein phosphate + ADP by a mitogen-activated protein kinase, as part of a MAPK signaling cascade that contributes to conjugation with cellular fusion.'),('GO:0038072','obsolete MAP kinase kinase activity involved in conjugation with cellular fusion','MF','OBSOLETE Catalysis of the concomitant phosphorylation of threonine (T) and tyrosine (Y) residues in a Thr-Glu-Tyr (TEY) thiolester sequence in a MAP kinase (MAPK) substrate, as part of a MAPK signaling cascade that contributes to conjugation with cellular fusion.'),('GO:0038073','obsolete MAP kinase kinase kinase activity involved in conjugation with cellular fusion','MF','OBSOLETE. Catalysis of the phosphorylation and activation of a MAP kinase kinase (MAPKK), as part of a MAPK signaling cascade that contributes to cell wall biogenesis.'),('GO:0038074','obsolete MAP kinase phosphatase activity involved in regulation of conjugation with cellular fusion','MF','OBSOLETE. Catalysis of the reaction: a phosphorylated MAP kinase + H2O = a MAP kinase + phosphate, where the MAP kinase (MAPK) is part of a MAPK signaling cascade that contributes to conjugation with cellular fusion.'),('GO:0038076','obsolete MAP kinase kinase activity involved in innate immune response','MF','OBSOLETE. Catalysis of the concomitant phosphorylation of threonine (T) and tyrosine (Y) residues in a Thr-Glu-Tyr (TEY) thiolester sequence in a MAP kinase (MAPK) substrate, as part of a MAPK signaling cascade that contributes to an innate immune response.'),('GO:0038077','obsolete MAP kinase kinase kinase activity involved in innate immune response','MF','OBSOLETE. Catalysis of the phosphorylation and activation of a MAP kinase kinase (MAPKK), as part of a MAPK signaling cascade that contributes to an innate immune response.'),('GO:0038079','obsolete MAP kinase activity involved in osmosensory signaling pathway','MF','OBSOLETE. Catalysis of the reaction: protein + ATP = protein phosphate + ADP by a mitogen-activated protein kinase, as part of a MAPK signaling cascade that passes on a signal within an osmosensory signaling pathway.'),('GO:0038080','obsolete MAP kinase kinase activity involved in osmosensory signaling pathway','MF','OBSOLETE. Catalysis of the concomitant phosphorylation of threonine (T) and tyrosine (Y) residues in a Thr-Glu-Tyr (TEY) thiolester sequence in a MAP kinase (MAPK) substrate, as part of a MAPK signaling cascade that passes on a signal within an osmosensory signaling pathway.'),('GO:0038081','obsolete MAP kinase kinase kinase activity involved in osmosensory signaling pathway','MF','OBSOLETE. Catalysis of the phosphorylation and activation of a MAP kinase kinase (MAPKK), as part of a MAPK signaling cascade that passes on a signal within an osmosensory signaling pathway.'),('GO:0038082','obsolete MAP kinase phosphatase activity involved in regulation of osmosensory signaling pathway','MF','OBSOLETE Catalysis of the reaction: a phosphorylated MAP kinase + H2O = a MAP kinase + phosphate, where the MAP kinase (MAPK) is part of a MAPK signaling cascade that passes on a signal within an osmosensory signaling pathway.'),('GO:0039541','obsolete suppression by virus of host RIG-I via RIG-I binding','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of RIG-I (also known as DDX58) by interacting selectively and non-covalently with RIG-I itself.'),('GO:0039542','obsolete suppression by virus of host RIG-I K63-linked ubiquitination','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the rate or extent of K63-linked ubiquitination of RIG-I (also known as DDX58), thereby suppressing RIG-I signal transduction. Lys63-linked ubiquitination of the N-terminal CARD domains of RIG-I is crucial for the cytosolic RIG-I signaling pathway to elicit host antiviral innate immunity.'),('GO:0039543','obsolete suppression by virus of host RIG-I activity by viral RNA 5\' processing','BP','OBSOLETE. The post-transcriptional removal by a virus of the 5\' triphosphate group of their viral RNA, thereby preventing host RIG-I from recognizing viral RNA in the host cell. The intracellular pattern recognition receptor RIG-I (also known as DDX58) recognizes viral RNAs containing 5\' triphosphates; removal by the virus of the 5\'-terminal triphosphate group from their genome protects the viral RNA from RIG-recognition.'),('GO:0039544','obsolete suppression by virus of host RIG-I activity by RIG-I proteolysis','BP','OBSOLETE. The chemical reactions and pathways performed by a virus resulting in the hydrolysis of the host RIG-I protein (also known as DDX58) by cleavage of peptide bonds, thereby inhibiting RIG-I signal transduction.'),('GO:0039546','obsolete suppression by virus of host MAVS activity by MAVS proteolysis','BP','OBSOLETE. The chemical reactions and pathways performed by a virus resulting in the hydrolysis of the host MAVS (mitochondrial inhibitor of viral signaling) protein by cleavage of peptide bonds, thereby inhibiting the host innate immune response. For example, MAVS harbors a C-terminal transmembrane domain that targets it to the mitochondrial outer membrane; cleavage within this domain removes MAVS from the membrane, thus preventing it from signaling.'),('GO:0039549','obsolete suppression by virus of host IRF3 activity by inhibition of IRF3 phosphorylation','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the rate or extent of the phosphorylation of IRF3 (interferon regulatory factor-3), thereby inhibiting IRF3 activation. In response to signaling from RIG-1/MDA-5 receptors, IRF3 is phosphorylated on multiple serine and threonine residues; phosphorylation results in the cytoplasm-to-nucleus translocation of IRF3, DNA binding, and increased transcriptional activation of interferon-encoding genes.'),('GO:0039550','obsolete suppression by virus of host IRF3 activity by inhibition of DNA binding','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces IRF3-dependent gene transcription, by preventing or reducing IRF3 binding to promoter sites.'),('GO:0039551','obsolete suppression by virus of host IRF3 activity by positive regulation of IRF3 catabolic process','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of host IRF3 (interferon regulatory factor-3) by promoting the ubiquitin-dependent degradation of IRF3, mediated by the proteasome.'),('GO:0039555','obsolete suppression by virus of host MDA-5 activity via MDA-5 binding','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of MDA-5 (also known as IFIH1) by interacting selectively and non-covalently with MDA-5 itself. For example, direct binding of viral proteins to the host MDA-5 protein can inhibit interaction of MDA-5 with MAVS, its downstream signaling effector.'),('GO:0039558','obsolete suppression by virus of host IRF7 activity by positive regulation of IRF7 sumoylation','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces IRF7-dependent gene transcription, by promoting the sumoylation of IRF7, thereby disabling its activity.'),('GO:0039559','obsolete suppression by virus of host IRF7 activity by positive regulation of IRF7 catabolic process','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of host IRF7 (interferon regulatory factor-7) by promoting the ubiquitin-dependent degradation of IRF7, mediated by the proteasome.'),('GO:0039561','obsolete suppression by virus of host IRF9 activity by positive regulation of IRF9 localization to nucleus','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of host IRF9 (interferon regulatory factor-9) by promoting the nuclear accumulation of IRF9. For example, the reovirus mu2 protein promotes nuclear accumulation of host IRF9 by an as yet unconfirmed-mechanism.'),('GO:0039565','obsolete suppression by virus of host STAT1 activity by positive regulation of STAT1 catabolic process','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of host STAT1 (signal transducer and activator of transcription-1) by promoting the ubiquitin-dependent degradation of STAT1, mediated by the proteasome.'),('GO:0039566','obsolete suppression by virus of host STAT1 activity by tyrosine dephosphorylation of STAT1','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host STAT1 (signal transducer and activator of transcription-1) activity by the removal of phosphoric residues from STAT1-O-phospho-tyrosine to form STAT1-tyrosine. For example, the viral phosphatase VH1 dephosphorylates STAT1 to reverse STAT1 activation.'),('GO:0039567','obsolete suppression by virus of host STAT1 activity by negative regulation of STAT protein import into nucleus','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host STAT1 (signal transducer and activator of transcription-1) activity by retaining STAT1 in the cytoplasm, so STAT1 is unable to translocate to the nucleus to activate transcription of its target genes.'),('GO:0039568','obsolete suppression by virus of host STAT1 activity by inhibition of DNA binding','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces STAT1-dependent gene transcription, by preventing STAT1 from binding to promoter sites in the nucleus.'),('GO:0039569','obsolete suppression by virus of host STAT2 activity by positive regulation of STAT2 catabolic process','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of host STAT2 (signal transducer and activator of transcription-2) by promoting the ubiquitin-dependent degradation of STAT2, mediated by the proteasome.'),('GO:0039570','obsolete suppression by virus of host STAT2 activity by negative regulation of STAT protein import into nucleus','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host STAT2 (signal transducer and activator of transcription-2) activity by retaining STAT2 in the cytoplasm, so STAT2 is unable to translocate to the nucleus to activate transcription of its target genes.'),('GO:0039571','obsolete suppression by virus of host STAT1 activity by negative regulation of STAT1 tyrosine phosphorylation','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host STAT1 (signal transducer and activator of transcription-1) activity by stopping, preventing, or reducing the frequency, rate or extent of the introduction of a phosphate group to a tyrosine residue of a STAT1 protein. For example, the measles virus V protein inhibits tyrosine phosphorylation of STAT1, thereby preventing STAT1 activation.'),('GO:0039572','obsolete suppression by virus of host STAT2 activity by negative regulation of STAT2 tyrosine phosphorylation','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host STAT2 (signal transducer and activator of transcription-2) activity by stopping, preventing, or reducing the frequency, rate or extent of the introduction of a phosphate group to a tyrosine residue of a STAT2 protein. For example, the measles virus V protein inhibits tyrosine phosphorylation of STAT2, thereby preventing STAT2 activation.'),('GO:0039575','obsolete suppression by virus of host TYK2 activity by negative regulation of TYK2 tyrosine phosphorylation','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host TYK2 (tyrosine kinase 2) activity by stopping, preventing or reducing phosphorylation and thereby activation of TYK2.'),('GO:0039577','obsolete suppression by virus of host JAK1 activity by negative regulation of JAK1 phosphorylation','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host JAK1 (Janus Kinase 1) activity by stopping, preventing or reducing tyrosine phosphorylation of JAK1 and thereby activation of JAK1.'),('GO:0039578','obsolete suppression by virus of host JAK1 activity via JAK1 binding','BP','OBSOLETE.  Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host JAK1 (Janus Kinase 1) activity by interacting directly and selectively with JAK1. For example, the polyoma virus T antigen binds to JAK1 and renders it inactive.'),('GO:0039581','obsolete suppression by virus of host PKR activity via double-stranded RNA binding','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host PKR (protein kinase regulated by RNA) activity by interacting selectively and non-covalently with double-stranded RNA (dsRNA). Binding of viral proteins to RNA may sequester or alter the RNA so it can not be recognized by host PKR, or may compete with PKR for dsRNA binding.'),('GO:0039582','obsolete suppression by virus of host PKR activity by positive regulation of PKR nuclear localization','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host PKR (protein kinase regulated by RNA) activity by promoting the localization of PKR in the nucleus. For example, human cytomegalovirus (HMCV) gene products directly interact with PKR and inhibit its activation by sequestering it in the nucleus, away from both its activator (cytoplasmic dsRNA) and its substrate, (eIF2alpha).'),('GO:0039583','obsolete suppression by virus of host PKR activity by positive regulation of PKR catabolic process','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the frequency, rate or extent of host PKR (protein kinase regulated by RNA) activity by promoting the degradation of PKR via the proteosome. For example, the Rift Valley fever virus (RVFV) NSs protein induces the down-regulation of PKR by degradation through proteasomes.'),('GO:0039598','obsolete induction by virus of host nuclear polyadenylation-dependent mRNA catabolic process','BP','OBSOLETE. The process in which a virus increases the frequency, rate or extent of the breakdown of host messenger RNA (mRNA) initiated by the enzymatic addition of a sequence of adenylyl residues (polyadenylation) at the 3\' end the target mRNA.'),('GO:0039605','obsolete TFIIB-class transcription factor binding involved in viral suppression of host transcription initiation from RNA polymerase II promoter','MF','OBSOLETE. Selective and non-covalent interaction of a viral protein with a member of the TFIIB-class of host transcription factors, which contributes to the viral-suppression of assembly of the RNA polymerase II preinitiation complex (PIC) at an RNA polymerase II promoter region of a host DNA template.'),('GO:0039607','obsolete proteolysis by virus of host translation initiation factor','BP','OBSOLETE. The chemical reactions and pathways performed by a virus resulting in the hydrolysis of a host translation initiation factor by cleavage of its peptide bonds.'),('GO:0039608','obsolete suppression by virus of host translation initiation factor activity by induction of host protein dephosphorylation','BP','OBSOLETE. Any process in which a virus prevents or reduces the frequency, rate or extent of activity of a host translation initiation factor by promoting dephosphorylation of a host protein.'),('GO:0039655','obsolete transport of virus in host, cell to cell via plasmodesmata','BP','OBSOLETE The transport of a virus between adjacent cells in a multicellular organism using plasmodesmata. Plasmodesma is a fine cytoplasmic channel found in all higher plants, which connects the cytoplasm of one cell to that of an adjacent cell.'),('GO:0039659','obsolete suppression by virus of host TBK1-IKBKE-DDX3 complex activity','BP','OBSOLETE. Any process in which a virus stops, prevents, or reduces the activity of the host TBK1-IKBKE-DDX3 complex.'),('GO:0040006','obsolete protein-based cuticle attachment to epithelium','BP','OBSOLETE. Attaching of a protein-based cuticle to the epithelium underlying it.'),('GO:0042027','obsolete cyclophilin-type peptidyl-prolyl cis-trans isomerase activity','MF','OBSOLETE. Catalysis of the reaction: peptidylproline (omega=180) = peptidylproline (omega=0).'),('GO:0042029','obsolete fibrolase activity','MF','OBSOLETE. Catalysis of the cleavage of 14-Ala-Leu-15 in insulin B chain and cleavage of 413-Lys-Leu-414 in alpha chain of fibrinogen.'),('GO:0042031','obsolete angiotensin-converting enzyme inhibitor activity','MF','OBSOLETE. Stops, prevents or reduces the activity of angiotensin-converting enzyme, thereby preventing the synthesis of angiotensin II from its precursor, angiotensin I.'),('GO:0042057','obsolete transforming growth factor beta receptor anchoring activity','MF','OBSOLETE. Binds to transforming growth factor beta receptor and anchors it to a particular subcellular location.'),('GO:0042064','obsolete cell adhesion receptor regulator activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0042072','obsolete cell adhesion receptor inhibitor activity','MF','OBSOLETE (was not defined before being made obsolete).'),('GO:0042079','obsolete GPI/GSI anchor metabolic process','BP','OBSOLETE (was not defined before being made obsolete).'),('GO:0042080','obsolete GPI/GSI anchor biosynthetic process','BP',