'),('GO:0042394','obsolete ecdysis, protein-based cuticle','BP','OBSOLETE. The shedding of the old protein-based cuticular fragments during the molting cycle. Examples of this process are found in invertebrates.'),('GO:0042408','obsolete myrcene/(E)-beta-ocimene synthase activity','MF','OBSOLETE. Catalysis of the conversion of geranyl diphosphate (GPP) into the acyclic monoterpenes beta-myrcene, (E)-beta-ocimene, and other minor cyclic monoterpenes.'),('GO:0042499','obsolete signal peptide peptidase activity','MF','OBSOLETE. Catalysis of the intramembrane proteolysis of a signal peptide, following its removal from a preprotein.'),('GO:0042563','obsolete importin alpha-subunit nuclear export complex','CC','OBSOLETE. A protein complex which usually consists of three components, e.g. in Xenopus, the importin alpha-subunit/CAS/Ran, and which functions to transport the importin alpha-subunit out of the nucleus through the nuclear pore.'),('GO:0042576','obsolete aspartyl aminopeptidase activity','MF','OBSOLETE. Catalysis of the release of an N-terminal aspartate or glutamate from a peptide, with a preference for aspartate.'),('GO:0042598','obsolete vesicular fraction','CC','OBSOLETE: Any of the small, heterogeneous, artifactual, vesicular particles that are formed when some cells are homogenized.'),('GO:0042708','obsolete elastase activity','MF','OBSOLETE. Catalysis of the hydrolysis of elastin.'),('GO:0042798','obsolete protein neddylation during NEDD8 class-dependent protein catabolic process','BP','OBSOLETE. Covalent attachment of the ubiquitin-like protein NEDD8 (or equivalent protein) to another protein, as a part of NEDD8-dependant protein catabolism.'),('GO:0042801','obsolete polo kinase kinase activity','MF','OBSOLETE Catalysis of the addition of a phosphate group onto a serine or threonine residue in any member of the polo kinase class of proteins. This term was made obsolete because it represents a gene product and also refers to a non-existent activity (polo ki