 The process of directing proteins towards a membrane using signals contained within the protein, occurring that contributes to ubiquitin-dependent protein catabolism via the MVB pathway; the destruction of a protein or peptide covalently tagged with a ubiquitin, via the multivesicular body (MVB) sorting pathway.'),('GO:0043345','obsolete neuroblast division','BP','OBSOLETE. The asymmetrical division of a neuroblast, the neural precursor in the central nervous system, giving rise to another neuroblast and a ganglion mother cell.'),('GO:0043346','obsolete neuroblast division','BP','OBSOLETE. The asymmetrical division of a neuroblast, the neural precursor in the central nervous system, giving rise to another neuroblast and a ganglion mother cell.'),('GO:0043411','obsolete myopalladin binding','MF','OBSOLETE. Interacting selectively and non-covalently with myopalladin, a myofibrillar protein with titin-like Ig domains.'),('GO:0043459','obsolete response to short exposure to lithium ion','BP','OBSOLETE. A change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a single or short exposure to a lithium ion stimulus.'),('GO:0043460','obsolete response to long exposure to lithium ion','BP','OBSOLETE. A change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a long or persistent exposure to a lithium ion stimulus.'),('GO:0043498','obsolete cell surface binding','MF','OBSOLETE. Interacting selectively and non-covalently with any component on the surface of a cell.'),('GO:0043499','obsolete eukaryotic cell surface binding','MF','OBSOLETE. Interacting selectively and non-covalently with any component on the surface of a eukaryotic cell.'),('GO:0043526','obsolete neuroprotection','BP','OBSOLETE. Any process that modulates the occurrence or rate of cell death by apoptosis in the nervous system. It may stop o