ing a phosphate group into inositol or a phosphatidylinositol. Inositol is the cyclic alcohol 1,2,3,4,5,6-cyclohexanehexol, which is widely distributed in nature and acts as a growth factor in animals and microorganisms.'),('GO:0046908','obsolete negative regulation of crystal formation','BP','OBSOLETE. Any process that stops, prevents, or reduces the frequency, rate or extent of the spontaneous (nonenzymatic) formation of crystals in a solution, for example, calcium oxalate crystals in urine.'),('GO:0046909','obsolete intermembrane transport','BP','OBSOLETE. The directed movement of substances between any membrane of a cell, including the plasma membrane and its regions.'),('GO:0046973','obsolete histone lysine N-methyltransferase activity (H3-K24 specific)','MF','OBSOLETE. Catalysis of the addition of a methyl group onto lysine at position 24 of the histone H3 protein.'),('GO:0047193','obsolete CDP-acylglycerol O-arachidonoyltransferase activity','MF','OBSOLETE. Catalysis of the reaction: CDP-acylglycerol + arachidonyl-CoA = CDP-diacylglycerol + CoA.'),('GO:0047687','obsolete ascorbate 2,3-dioxygenase activity','MF','OBSOLETE. Catalysis of the reaction: L-ascorbate + H(2)O + O(2) = L-threonate + 2 H(+) + oxalate.'),('GO:0047859','obsolete dihydroxyphenylalanine ammonia-lyase activity','MF','OBSOLETE. Catalysis of the reaction: 3,4-dihydroxy-L-phenylalanine = trans-caffeate + NH3.'),('GO:0048151','obsolete hyperphosphorylation','BP','OBSOLETE. The excessive phosphorylation of a protein, as a result of activation of kinases, deactivation of phosphatases, or both.'),('GO:0048184','obsolete follistatin binding','MF','OBSOLETE. Interacting selectively and non-covalently with the peptide hormone follistatin.'),('GO:0048191','obsolete peptide stabilization activity','MF','OBSOLETE. Strengthening of a bond between peptides. Peptides are compounds of two or more amino acids where the alpha carboxyl group of one is bound to the alpha amino group of another.'),('GO:0048192','obsolete peptide antigen stabilization activity','MF','OBSOLETE. Strengthening of a bond with a peptide antigen; a fragment of a foreign protein derived by proteolysis within the cell.'),('GO:0048196','obsolete plant extracellular matrix','CC','The matrix external to the plant plasma membrane, composed of the cell wall and middle lamella.'),('GO:0048228','obsolete actin cortical patch distribution','BP','OBSOLETE. Any process that establishes the spatial arrangement of actin cortical patches. An actin cortical patch is a discrete actin-containing structure found at the plasma membrane in fungal cells.'),('GO:0048277','obsolete nonexocytotic vesicle docking','BP','OBSOLETE. The initial attachment of a transport vesicle membrane to a target membrane, mediated by proteins protruding from the membrane of the vesicle and the target membrane, during a non-exocytotic process.'),('GO:0048503','obsolete GPI anchor binding','MF','OBSOLETE. Interacting selectively with any glycosylphosphatidylinositol anchor. GPI anchors serve to attach membrane proteins to the lipid bilayer of cell membranes.'),('GO:0048516','obsolete trichome initiation (sensu Magnoliophyta)','BP','OBSOLETE. Processes causing the differentiation of an epidermal cell into a trichome cell; as in, but not restricted to, the flowering plants (Magnoliophyta, ncbi_taxonomy_id:3398).'),('GO:0048517','obsolete positive regulation of trichome initiation (sensu Magnoliophyta)','BP','OBSOLETE. Any process that activates or increases the frequency, rate or extent of trichome initiation; as in, but not restricted to, the flowering plants (Magnoliophyta, ncbi_taxonomy_id:3398).'),('GO:0048610','obsolete cellular process involved in reproduction','BP','OBSOLETE. A process, occurring at the cellular level, that is involved in the reproductive function of a multicellular or single-celled organism.'),('GO:0048622','obsolete reproductive sporulation','BP','OBSOLETE. The formation of reproductive spores.'),('GO:0048740','obsolete striated muscle fiber development','BP','OBSOLETE. The process whose specific outcome is the amplification and progression of myoblasts (muscle precursor cells) into terminally differentiated multinucleated muscle fibers.'),('GO:0048746','obsolete smooth muscle fiber development','BP','OBSOLETE. The process whose specific outcome is the progression of smooth muscle fiber over time, from its formation to the mature structure.'),('GO:0050027','obsolete L-idonate 2-dehydrogenase activity','MF','OBSOLETE. Catalysis of the reaction: L-idonate + NADP+ = 5-dehydro-D-gluconate + NADPH.'),('GO:0050424','obsolete alanine carboxypeptidase activity','MF','OBSOLETE. Catalysis of the reaction: H2O + peptidyl-L-alanine = L-alanine + peptide. The release of a C-terminal alanine from a peptide or a variety of pteroyl or acyl groups.'),('GO:0050425','obsolete carboxypeptidase B activity','MF','OBSOLETE. Catalysis of the reaction: H2O + peptidyl-L-lysine (or L-arginine) = L-lysine (or L-arginine) + peptide. Preferential release of a C-terminal lysine or arginine amino acid.'),('GO:0050426','obsolete peptidyl-glycinamidase activity','MF','OBSOLETE. Catalysis of the reaction: H2O + peptidyl-glycinamide = glycinamide + peptide. Cleavage of C-terminal glycinamide from a polypeptide.'),('GO:0050466','obsolete oxidoreductase activity, acting on X-H and Y-H to form an X-Y bond, with other acceptors','MF','OBSOLETE. Catalysis of an oxidation-reduction (redox) reaction in which X-H and Y-H form X-Y and the acceptor is not disulfide or oxygen.'),('GO:0050516','obsolete inositol polyphosphate multikinase activity','MF','OBSOLETE. Catalysis of the reactions: ATP + 1D-myo-inositol 1,4,5-trisphosphate = ADP + 1D-myo-inositol 1,4,5,6-tetrakisphosphate, and ATP + 1D-myo-inositol 1,4,5,6-tetrakisphosphate = ADP + 1D-myo-inositol 1,3,4,5,6-pentakisphosphate.'),('GO:0050517','obsolete inositol hexakisphosphate kinase activity','MF','OBSOLETE. Catalysis of the reactions: ATP + 1D-myo-inositol hexakisphosphate = ADP + 5-diphospho-1D-myo-inositol (1,2,3,4,6)pentakisphosphate, and ATP + 1D-myo-inositol 1,3,4,5,6-pentakisphosphate = ADP + diphospho-1D-myo-inositol tetrakisphosphate (isomeric configuration unknown).'),('GO:0050523','obsolete oxidoreductase activity, acting on phosphorus or arsenic in donors, with other acceptors','MF','OBSOLETE. Catalysis of an oxidation-reduction (redox) reaction in which phosphorus or arsenic acts as a hydrogen or electron donor and reduces an acceptor other than disulfide, NAD or NADP.'),('GO:0050749','obsolete apolipoprotein E receptor binding','MF','OBSOLETE. Interacting selectively with an apolipoprotein E receptor.'),('GO:0050800','obsolete hydrolase activity, acting on acid anhydrides, acting on GTP, involved in cellular and subcellular movement','MF','OBSOLETE. Catalysis of the hydrolysis of GTP to directly drive the cellular or subcellular transport of a substance.'),('GO:0050983','obsolete deoxyhypusine biosynthetic process from spermidine','BP','The chemical reactions resulting in the formation of deoxyhypusine from spermidine by the enzyme [eIF-5A]-deoxyhypusine synthase. The reaction occurs in four steps: 1. spermidine + NAD+ = dehydrospermidine + NADH + H+; 2. dehydrospermidine + [enzyme]-lysine = 1,3-diaminopropane + [enzyme]-lysine-N6=CH(CH2)3NH2; 3. [enzyme]-lysine-N6=CH(CH2)3NH2 = [eIF-5A]-lysine-N6=CH(CH2)3NH2; 4. [eIF-5A]-lysine-N6=CH(CH2)3NH2 + NADH + H+ = [eIF-5A]-deoxyhypusine + NAD+.'),('GO:0051074','obsolete protein tetramerization activity','MF','OBSOLETE. The formation of a protein tetramer, a macromolecular structure consisting of four noncovalently associated identical or nonidentical subunits.'),('GO:0051076','obsolete Gram-positive bacterial cell surface binding','MF','OBSOLETE. Interacting selectively and non-covalently with any component on the surface of a Gram-positive bacterium.'),('GO:0051370','obsolete ZASP binding','MF','OBSOLETE. Interacting selectively and non-covalently with Z-band alternatively spliced PDZ motif protein (ZASP). ZASP is a Z-band protein specifically expressed in heart and skeletal muscle. This protein contains N-terminal PDZ domain and C-terminal LIM domain.'),('GO:0051397','obsolete N-terminal basic amino acid aminopeptidase activity','MF','OBSOLETE. Catalysis of the hydrolysis of basic amino acid residues at the N-terminal of an oligopeptide or polypeptide chain.'),('GO:0051398','obsolete N-terminal lysine aminopeptidase activity','MF','OBSOLETE. Catalysis of the hydrolysis of a lysine residue from the N-terminal of an oligopeptide or polypeptide chain.'),('GO:0051399','obsolete N-terminal arginine aminopeptidase activity','MF','OBSOLETE. Catalysis of the hydrolysis of an arginine residue from the N-terminal of an oligopeptide or polypeptide chain.'),('GO:0051404','obsolete clostripain activity','MF','OBSOLETE. Catalysis of the cleavage of Arg-Xaa bonds.'),('GO:0051405','obsolete microbial collagenase activity','MF','OBSOLETE. Catalysis of the digestion of native collagen in the triple helical region at Xaa-Gly bonds.'),('GO:0051411','obsolete ALP binding','MF','OBSOLETE. Interacting selectively and non-covalently wih ALP, actinin-associated LIM protein of the Z band. ALP is a PDZ/LIM domain protein found in the Z band.'),('GO:0051416','obsolete myotilin binding','MF','OBSOLETE. Interacting selectively and non-covalently with myotilin, a structural component of the Z-discs in human skeletal and cardiac muscle. Its C-terminus contains two immunoglobulin-like domains and the unique N-terminal half has a serine-rich region, with numerous potential phosphorylation sites, and a stretch of hydrophobic amino acids. Myotilin forms homodimers and binds to alpha-actinin, F-actin, and filamin C.'),('GO:0051419','obsolete nebulin binding','MF','OBSOLETE. Interacting selectively and non-covalently with nebulin, a large protein (approximately 800kD) that is anchored at the Z-disc by its C-terminal region and spans the length of the thin filament, ending at the edge of the H-zone.'),('GO:0051420','obsolete nebulette binding','MF','OBSOLETE. Interacting selectively and non-covalently with nebulette, a 107 kDa protein associated with the I-Z-I complex of cardiac myofibrils. It shows a high degree of homology with skeletal muscle nebulin.'),('GO:0051635','obsolete bacterial cell surface binding','MF','OBSOLETE. Interacting selectively and non-covalently with any component on the surface of a bacterial cell.'),('GO:0051636','obsolete Gram-negative bacterial cell surface binding','MF','OBSOLETE. Interacting selectively and non-covalently with any component on the surface of a Gram-negative bacterial cell.'),('GO:0051637','obsolete Gram-positive bacterial cell surface binding','MF','OBSOLETE. Interacting selectively and non-covalently with any component on the surface of a Gram-positive bacterium.'),('GO:0051727','obsolete cell cycle switching, meiotic to mitotic cell cycle','BP','OBSOLETE. The process in which a cell switches cell cycle mode from meiotic to mitotic division.'),('GO:0051789','obsolete response to protein','BP','OBSOLETE. Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a protein stimulus.'),('GO:0051827','obsolete growth or development on or near surface of other organism during symbiotic interaction','BP','OBSOLETE. The increase in size or mass of an organism, or the progression of an organism from an initial condition to a later condition, occurring on or near the exterior of a second organism, where the two organisms are in a symbiotic interaction.'),('GO:0051831','obsolete growth or development in other organism during symbiotic interaction','BP','OBSOLETE. The increase in size or mass of an organism, or the progression of an organism from an initial condition to a later condition, occurring within the cells or tissues of a second organism, where the two organisms are in a symbiotic interaction. This may (but not necessarily) include a filamentous growth form, and also can include secretion of proteases and lipases to break down the tissue of the second organism.'),('GO:0051842','obsolete evasion or tolerance of symbiont immune response','BP','OBSOLETE. Any process, either active or passive, by which an organism avoids the effects of the symbiont organism\'s immune response. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051843','obsolete evasion or tolerance of symbiont defense response','BP','OBSOLETE. Any process, either active or passive, by which an organism avoids or tolerates the effects of a symbiont organism\'s defense response. The symbiont defense response is mounted by the symbiont in response to the presence of the organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051845','obsolete passive evasion of symbiont immune response','BP','OBSOLETE. Any mechanism of immune avoidance that does not directly interfere with the symbiont immune system. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051846','obsolete active evasion of symbiont immune response','BP','OBSOLETE. Any mechanism of immune avoidance that directly affects the symbiont immune system, e.g. blocking any stage in symbiont MHC class I and II presentation. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051847','obsolete active evasion of symbiont immune response via regulation of symbiont complement system','BP','OBSOLETE. Any mechanism of active immune avoidance which works by regulating the symbiont complement system, e.g. by possessing complement receptors which mediate attachment to, then infection of, symbiont macrophages, which are eventually destroyed. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051848','obsolete active evasion of symbiont immune response via regulation of symbiont cytokine network','BP','OBSOLETE. Any mechanism of active immune avoidance which works by regulating symbiont cytokine networks, e.g. by secreting proteins that mimic cytokine receptors that act to sequester symbiont cytokines and inhibit action. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051849','obsolete active evasion of symbiont immune response via regulation of symbiont antigen processing and presentation','BP','OBSOLETE. Any mechanism of active immune avoidance which works by regulating the symbiont\'s antigen processing or presentation pathways, e.g. by blocking any stage in MHC class II presentation. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051853','obsolete induction in symbiont of tumor, nodule, or growth','BP','OBSOLETE. The process by which an associated organism causes the formation of an abnormal mass of cells in the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051854','obsolete induction in symbiont of tumor, nodule, or growth containing transformed cells','BP','OBSOLETE. The process by which an organism causes the formation in its symbiont organism of an abnormal growth whose cells have been transformed and continue to exist in the absence of the first organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051857','obsolete growth or development of organism on or near symbiont surface','BP','OBSOLETE. The increase in size or mass of an organism, or the progression of an organism from an initial condition to a later condition, occurring on or near the exterior of its symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051863','obsolete translocation of DNA into symbiont','BP','OBSOLETE. The directed movement of DNA from an organism to a location inside the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0051925','obsolete regulation of calcium ion transport via voltage-gated calcium channel activity','BP','OBSOLETE. Any process that modulates the frequency, rate or extent of the directed movement of calcium ions via a voltage-gated calcium channel.'),('GO:0051927','obsolete negative regulation of calcium ion transport via voltage-gated calcium channel activity','BP','OBSOLETE. Any process that stops, prevents, or reduces the frequency, rate or extent of the directed movement of calcium ions via a voltage-gated calcium channel.'),('GO:0051929','obsolete positive regulation of calcium ion transport via voltage-gated calcium channel activity','BP','OBSOLETE. Any process that activates or increases the frequency, rate or extent of the directed movement of calcium ions via the activity of voltage-gated calcium channels.'),('GO:0052108','obsolete growth or development of symbiont during interaction with host','BP','OBSOLETE. The increase in size or mass of an organism, or the progression of an organism from an initial condition to a later condition, occurring in, on or near the exterior of its host organism. The host is defined as the larger of the organisms involved in a symbiotic interaction.'),('GO:0052113','obsolete adaptation to host osmotic environment','BP','OBSOLETE. The responsive adjustment of an organism to the osmotic conditions in or around its host organism. The host is defined as the larger of the organisms involved in a symbiotic interaction.'),('GO:0052114','obsolete adaptation to host pH environment','BP','OBSOLETE. The responsive adjustment of an organism to the pH conditions in or around its host organism. The host is defined as the larger of the organisms involved in a symbiotic interaction.'),('GO:0052171','obsolete growth or development during symbiotic interaction','BP','OBSOLETE. The increase in size or mass of an organism, or the progression of an organism from an initial condition to a later condition, occurring when the organism is in a symbiotic interaction.'),('GO:0052184','obsolete modulation by organism of symbiont hormone or growth regulator levels','BP','OBSOLETE. The alteration by an organism of the levels of hormones or growth regulators in the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052193','obsolete movement in symbiont environment','BP','The directed movement of an organism or motile cell on, within or near its symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052194','obsolete movement on or near symbiont','BP','The directed movement of an organism or motile cell on or near its symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052326','obsolete interaction with symbiont via protein secreted by type IV secretion system','BP','OBSOLETE. An interaction with the symbiont organism mediated by a substance secreted by the other organism by a type IV secretion system. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052327','obsolete interaction with symbiont via protein secreted by type II secretion system','BP','OBSOLETE. An interaction with the symbiont organism mediated by a substance secreted by the other organism by a type II secretion system. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052328','obsolete interaction with symbiont via protein secreted by type III secretion system','BP','OBSOLETE. An interaction with the symbiont organism mediated by a substance secreted by the other organism by a type III secretion system. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052343','obsolete positive regulation by organism of symbiont phytoalexin production','BP','OBSOLETE. Any process in which an organism activates, maintains or increases the frequency, rate or extent of the production of phytoalexins as part of the defense response of the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052346','obsolete positive regulation by organism of defense-related symbiont nitric oxide production','BP','OBSOLETE. Any process in which an organism activates, maintains or increases the frequency, rate or extent of the production of nitric oxide as part of the defense response of the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052349','obsolete positive regulation by organism of defense-related symbiont reactive oxygen species production','BP','OBSOLETE. Any process in which an organism activates, maintains or increases the frequency, rate or extent of the production of reactive oxygen species as part of the defense response of the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052350','obsolete induction by organism of induced systemic resistance in symbiont','BP','OBSOLETE. Any process in which an organism activates induced systemic resistance in the symbiont; induced systemic resistance is a response that confers broad spectrum systemic resistance to disease and that does not depend upon salicylic acid signaling. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052351','obsolete induction by organism of systemic acquired resistance in symbiont','BP','OBSOLETE. Any process in which an organism activates systemic acquired resistance in the symbiont organism; systemic acquired resistance is a salicylic acid-mediated response that confers broad spectrum systemic resistance. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052375','obsolete evasion or tolerance by organism of symbiont-produced nitric oxide','BP','OBSOLETE. The process by which an organism avoids the effects of nitric oxide produced as a defense response by the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052377','obsolete evasion or tolerance by organism of symbiont-produced phytoalexins','BP','OBSOLETE. The process by which an organism avoids the effects of phytoalexins produced as a defense response by the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052383','obsolete induction by organism of symbiont innate immunity','BP','OBSOLETE. The activation by an organism of the innate immune response of the symbiont organism; the innate immune response is the symbiont\'s first line of defense against infection. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052384','obsolete evasion or tolerance by organism of symbiont-produced reactive oxygen species','BP','OBSOLETE. The process by which an organism avoids the effects of reactive oxygen species produced as a defense response by the symbiont organism. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052387','obsolete induction by organism of symbiont apoptosis','BP','OBSOLETE. Any process by which an organism activates programmed cell death in the symbiont, where programmed cell death proceeds by apoptosis. The symbiont is defined as the smaller of the organisms involved in a symbiotic interaction.'),('GO:0052392','obsolete induction by organism of defense-related symbiont calcium ion flux','BP','OBSOLETE. The activation by an organism of a flux 