us.'),('GO:1990480','obsolete geranyl diphosphate synthase','MF','OBSOLETE. Catalyzes the condensation of dimethylallyl diphosphate and isopentenyl diphosphate to geranyl diphosphate, the key precursor of monoterpene biosynthesis.'),('GO:1990493','obsolete cyclin H-CDK7 complex','CC','OBSOLETE. A protein complex consisting of cyclin H and cyclin-dependent kinase 7 (CDK7). Cyclins are characterized by periodicity in protein abundance throughout the cell cycle. Cyclin-dependent kinases represent a family of serine/threonine protein kinases that become active upon binding to a cyclin regulatory partner.'),('GO:1990494','obsolete regulation of mitotic cytokinesis, actomyosin contractile ring assembly','BP','OBSOLETE. Any process that modulates the frequency, rate or extent of mitotic cytokinesis, actomyosin contractile ring assembly.'),('GO:1990495','obsolete actin filament organization involved in mitotic cytokinetic actomyosin contractile ring assembly','BP','OBSOLETE. An actin filament organization process that contributes to actomyosin contractile ring assembly during mitotic cytokinesis.'),('GO:1990496','obsolete regulation of actin filament organization involved in mitotic cytokinetic actomyosin contractile ring assembly','BP','OBSOLETE. An actin filament organization process that contributes to regulation of actomyosin contractile ring assembly during mitotic cytokinesis.'),('GO:1990517','obsolete protein localization to photoreceptor outer segment','BP','OBSOLETE. A process in which a protein is transported to, or maintained in, a location within a photoreceptor outer segment, which is a portion of a modified sensory cilium.'),('GO:1990560','obsolete DNA methyltransferase binding','MF','OBSOLETE. Interacting selectively and non-covalently with a DNA methyltransferase.'),('GO:1990568','obsolete MIS18 complex','CC','OBSOLETE. A centromere complex assembly protein that is required for the deposition of CENP-A on the centromere. The Mis18 complex localizes to centro