 plays a major role in the regulation of blood pressure and salt-fluid volume homeostasis.'),('GO:1990628','obsolete Sigma-E factor negative regulation complex','CC','OBSOLETE. A protein complex consisting of RseA, RseB and RpoE. It form the inactive form of the sigma-E transcription factor. In response to stress, outer membrane proteins accumulate in the periplasm and activate cleavage of RseA periplasmic domain by DegS, triggering a proteolytic cascade that frees sigma-E to activate gene expression. RseB binding to RseA prevents activated DegS from cleaving RseA. Sigma-E-mediated envelope stress response is the major pathway to ensure homeostasis in the envelope compartment of the cell.'),('GO:1990639','obsolete inositol-3,4,5-trisphosphate 5-phosphatase activity','MF','OBSOLETE. Catalysis of the reaction: D-myo-inositol 3,4,5-trisphosphate + H2O = myo-inositol 3,4-bisphosphate + phosphate.'),('GO:1990642','obsolete response to castration','BP','OBSOLETE. Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a castration stimulus, deprivation of gonads.'),('GO:1990645','obsolete phosphorylase dephosphorylation','BP','OBSOLETE. The modification of phosphorylases by removal of phosphate groups.'),('GO:1990652','obsolete positive regulation of pyrimidine-containing compound salvage by positive regulation of transcription from RNA polymerase II promoter','BP','OBSOLETE. A positive regulation of transcription from RNA polymerase II promoter that results in positive regulation of pyrimidine-containing compound salvage.'),('GO:1990653','obsolete monounsaturated fatty acid biosynthetic process','BP','OBSOLETE. The chemical reactions and pathways resulting in the formation of a monounsaturated fatty acid. A monounsaturated fatty acid has one double bond in the fatty acid chain with all of the remainder carbon atoms being single-bonded, as opposed to polyu